import React from 'react'
import { PrimaryNav, MenuLink, Menu, Hamburger } from './NavElement'


function Navbar(){
  return (
    <>
      <PrimaryNav>
        <Hamburger />
        <Menu>
          <MenuLink to="/" activeStyle>
            Welcome to Blog App
          </MenuLink>
          {userd.length>0 &&
          <MenuLink to="/login" activeStyle>
            Login
          </MenuLink>}
          <MenuLink to="/posts" activeStyle>
            Blogs
          </MenuLink>
          <MenuLink to="/myposts" activeStyle>
            MyBlogs
          </MenuLink>
           {/* <MenuLink to="/comments" activeStyle>
            Comments
          </MenuLink> */}
        
        </Menu>
      </PrimaryNav>
    </>
  )
}


LoginAuthentication.propTypes = {
  fetchUser: PropTypes.func.isRequired,
  userd: PropTypes.array.isRequired
};


const mapStateToProps = state => ({
  userd: state.login.user
  
});


export default connect(mapStateToProps, {  })(Navbar);
